    were converted to rasters using GIS and then map algebra was used to calculate the
    total number of species in each huc12 watershed. Using GIS, an extended table was
    created to provide species lists by watershed using a one to many table relate.
    Species presence data was provided by PISCES: Moyle, Quinones and Bell (direct addition),
    Moyle and Randall (gstpoly), . These layers were generated by PISCES on 10/30/2014.
